var fs = require('fs');
var parse = require('csv-parse');

var inputFile='tmk2.csv';
console.log("Processing Countries file");

var parser = parse({delimiter: '; '}, function (err, data) {
    // when all countries are available,then process them
    // note: array element at index 0 contains the row of headers that we should skip
    for(line in data) {
      // create country object out of parsed fields
      var country = { "FPD Name" : line[0]
                    , "Shop Name" : line[1]
                    , "Address" : line[2]
                    , "Manager Name" : line[4]
                    , "Rice" : line[5]
                    , "Wheat" : line[6]
                    , "Kerosene" : line[7]
                    , "Dal" : line[8]
                    , "Rice Price" : line[9]
                    , "Wheat Price" : line[10]
                    , "Kerosene Price" : line[11]
                    , "Dal Price" : line[12]
                    };
     console.log(JSON.stringify(country));
    }
});

// read the inputFile, feed the contents to the parser
fs.createReadStream(inputFile).pipe(parser);
